  [],\n\t\"revision_timestamp\": \"2016-03-21T18:32:38.285704\",\n\t\"name\": \"gulf-of-alaska-acoustic-trawl-survey-of-walleye-pollock-dy1401-ek60\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Midwater Assessment and Conservation
  Engineering (MACE) program of NOAA National Marine Fisheries Service (NMFS), Alaska
  Fisheries Science Center (AFSC) conducted an acoustic-trawl (AT) stock assessment
  survey in the Shumagin Islands and Sanak Trough areas of the Gulf of Alaska (GOA)
  during the winter of 2014 to estimate the distribution and abundance of walleye
  pollock (Gadus chalcogrammus). The survey was conducted 21-28 February (Shumagin
  Islands 23-27 February; Sanak Trough 26 February), starting and ending in Kodiak,
  Alaska. The survey was conducted aboard NOAA Ship Oscar Dyson, a 64 meter stern
  trawler equipped with acoustic and oceanographic instrumentation. The primary instrument
  for the survey was a Simrad EK60 split-beam echosounder system utilizing five frequencies
  (18, 38, 70, 120, and 200 kHz).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
